import React from 'react'

const Person = (props) => {
   

    return (

        <div >
            <p>
                {props.person.name} {props.person.number}
                <button onClick={props.removePerson} person = {props.person}  >Delete </button>
                
            </p>
        </div >
        
    )
    
}


const ListPeople = (props) => {

    return (
        <div>
            {props.namesToShow.map((person) =>
                <Person key={person.name} person={person} removePerson={props.removePerson} />
                
            )}

        </div>
    )
}

export default ListPeople
